import React from 'react'

import Box from '@mui/material/Box'
import { AppBar } from '@mui/material'

function Footer() {
  return (
    <footer>
      <AppBar
        position="static"
        style={{
          background: '#2E3B55',
        }}
      ></AppBar>
      <Box sx={{ height: '5vh' }}></Box>
    </footer>
  )
}

export default Footer
